import React from 'react';
import Carousel from 'react-bootstrap/Carousel';
import firstImage from './images/IMG_1031.jpg';
import secondImage from "./images/IMG_4567.jpg";
import thirdImage from "./images/IMG_9591.jpg";
import './carousel.css'


function CarouselFadeExample() {
  return (
    <Carousel  fade>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={firstImage}
          class="slides"
          alt="First slide"
        />
        <Carousel.Caption>
          {/* <h3>My Image One</h3>
          <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p> */}
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          class="slides"
          src={secondImage}
          alt="Second slide"
        />
        <Carousel.Caption>
          <h3>My Image Two</h3>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          class="slides"
          src={thirdImage}
          alt="Third slide"
        />
        <Carousel.Caption>
          <h3>My Image Three</h3>
          <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
}

export default CarouselFadeExample;
